const Navigation = ({onRoteChange, isSignedIn}) =>{
        if(isSignedIn = true){
            return(
        <nav style ={{display: 'flex', justifyContent: 'flex-end'}}>
            <p onClick={() => onRoteChange('signIn')} className="f3 link dim black underline pa3 pointer"> Sign Out</p>
        </nav>
            );
        } else{
        return (
            <nav style ={{display: 'flex', justifyContent: 'flex-end'}}>
                <p onClick={() => onRoteChange('signIn')} className="f3 link dim black underline pa3 pointer"> Sign In</p>
                <p onClick={() => onRoteChange('Register')} className="f3 link dim black underline pa3 pointer"> Register</p>
            </nav> 
            );
        }
} 
export default Navigation
